import React from 'react'

const Navbar = () => {
  return (
    <div className='bg-gray-900 text-white p-4'>
        <h1 className='text-2xl font-bold'>User Management System</h1>
      {/* Now Navbar */}
      <nav>
        <ul className='display-flex gap-4 mt-2 '>
          <li>Dashboard</li>
          <li>Profile</li>
          <li>Settings</li>
          <li>Logout</li>
        </ul>
      </nav>




    </div>
  )
}

export default Navbar;
